    false,nt"url": null,nt"notes": "WASTE_TIRE_SITES_IDEM_IN is a point shapefile
    that contains waste tire site locations in Indiana, provided by personnel of Indiana
    Department of Environmental Management, Office of Land Quality (IDEM, OLQ) as of
    June 3, 2004 and was subsequently updated on January 4, 2005, April 25, 2005, July
    27, 2006, January 24, 2007, June 4, 2009, October 20, 2009, and April 16, 2010.
    The data set provided by IDEM was in an ESRI geodatabase format and the feature
    class was named "TIRE_SITES." WASTE_TIRE_SITES_IDEM_IN is attributed with facility
    names and federal identification numbers. The following is excerpted from the metadata
    provided by IDEM, OLQ for the source feature class TIRE_SITES: "This dataset consists
    of Tire Sites - sites which contain tires - either for processing, for storage,
    or transport - as well as some illegal tire dumps, as defined by IC 13-11-2-251,
    IC 13-11-2-252, and IC 13-11-250.5 of the Indiana Code."",nt"license_title":
